      SELECT + COUNT ( * ) * COUNT ( * ) col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 * ( - col2 ) NOT BETWEEN + + 2 AND NULL;
  - name: tab2

outputs:
  - name: q10751.out
    data: |
      9
